import React from 'react';

function TeamSection() {
    const presidents = [
        {
            name: "Matthieu Huss",
            role: "Co-Founder and President",
            image: "images/matthieu pfp.jpg",
            email: "president@quarcc.com",
            linkedin: "https://www.linkedin.com/in/matthieu-huss-915956230",
            bio: "As Co-Founder and President of QUARCC, I'm passionate about fostering innovation and collaboration in the AI community. My focus is on creating opportunities for students to engage with cutting-edge AI technologies and research."
        }
    ];

    const boardMembers = [
        {
            name: "Casey Jussaume",
            role: "Co-Founder and Director of Research",
            image: "images/casey pfp.jpg",
            email: "research@quarcc.com",
            linkedin: "https://www.linkedin.com/in/casey-jussaume/",
            bio: "Leading QUARCC's research initiatives, I work to bridge the gap between academic AI research and practical applications. I'm particularly interested in advancing AI safety and ethics in our community."
        },
        {
            name: "Valentino Magniette-Bosseboeuf",
            role: "Co-Founder and Director of Competitions",
            image: "images/valentino pfp.jpg",
            email: "competitions@quarcc.com",
            linkedin: "https://www.linkedin.com/in/valentino-mb/",
            bio: "As Director of Competitions, I'm responsible for organizing and managing various competitions within QUARCC. My goal is to create a platform where students can showcase their AI skills and knowledge."
        },
        {
            name: "Lucas Miranda",
            role: "Director of Innovation",
            image: "images/quarcc_logo.jpg",
            email: "innovation@quarcc.com",
            linkedin: "https://www.linkedin.com/in/cielofinsoen/",
            bio: "As Director of Innovation, I'm responsible for driving innovation and research within QUARCC. My focus is on identifying new opportunities and technologies that can be applied to AI research and development."
        },
        {
            name: "Augustine Davydchak",
            role: "Vice-President Finance",
            image: "images/augustine pfp.jpg",
            email: "info@quarcc.com",
            linkedin: "https://www.linkedin.com/in/augustine-davy-652563155/",
            bio: "As Vice-President Finance, I'm responsible for managing QUARCC's financial resources and ensuring the organization's financial stability. My focus is on budgeting, accounting, and financial reporting."
        },
        {
            name: "Jasmin Lauriere",
            role: "Vice-President Corporate Relations",
            image: "images/jasmin pfp.jpeg",
            email: "corporate@quarcc.com",
            linkedin: "https://www.linkedin.com/in/jasmin-l-20a7b5220/",
            bio: "As Vice-President Corporate Relations, I'm responsible for managing QUARCC's relationships with corporate partners and sponsors. My focus is on building strong partnerships and collaborations."
        },
        {
            name: "Maxime Hirret",
            role: "Vice-President Academics",
            image: "images/quarcc_logo.jpg",
            email: "",
            linkedin: "https://www.linkedin.com/in/maximehirret/",
            bio: "As Vice-President Academics, I'm responsible for managing QUARCC's academic programs and initiatives. My focus is on ensuring high-quality education and research within the organization."
        },
        {
            name: "Benjamin Vigneault-Motta",
            role: "Vice-President External Affairs",
            image: "images/ben pfp.jpg",
            email: "external@quarcc.com",
            linkedin: "https://www.linkedin.com/in/benjamin-vigneault-motta/",
            bio: "As Vice-President External Affairs, I'm responsible for managing QUARCC's relationships with external organizations and stakeholders. My focus is on building strong partnerships and collaborations."
        },
        {
            name: "Cloe Monteith",
            role: "Vice-President Internal Affairs",
            image: "images/quarcc_logo.jpg",
            email: "internal@quarcc.com",
            linkedin: "https://www.linkedin.com/in/cloe-monteith-a435301a9/",
            bio: "As Vice-President Internal Affairs, I'm responsible for managing QUARCC's internal affairs and operations. My focus is on ensuring efficient and effective operations within the organization."
        },
        {
            name: "Melanie Pomerleau",
            role: "Vice-President Marketing",
            image: "images/melanie pfp.jpeg",
            email: "marketing@quarcc.com",
            linkedin: "https://www.linkedin.com/in/melanie-pomerleau-199312224/",
            bio: "As Vice-President Marketing, I'm responsible for managing QUARCC's marketing and communications initiatives. My focus is on promoting the organization's brand and services."
        },
        {
            name: "Nicholas Thibodeau",
            role: "Vice-President Logistics",
            image: "images/quarcc_logo.jpg",
            email: "",
            linkedin: "https://www.linkedin.com/in/nicholas-thibodeau04/",
            bio: "As Vice-President Logistics, I'm responsible for managing QUARCC's logistics and operations. My focus is on ensuring efficient and effective operations within the organization."
        },
        {
            name: "Carter Cameron",
            role: "Vice-President Projects",
            image: "images/quarcc_logo.jpg",
            email: "projects@quarcc.com",
            linkedin: "https://www.linkedin.com/in/cartercameronfina/",
            bio: "As Vice-President Projects, I'm responsible for managing QUARCC's projects and initiatives. My focus is on ensuring high-quality projects and initiatives within the organization."
        },
        {
            name: "Daksh Seth",
            role: "AVP Corporate",
            image: "images/quarcc_logo.jpg",
            email: "",
            linkedin: "https://www.linkedin.com/in/daksh-seth-3137481a9/",
            bio: "As AVP Corporate, I'm responsible for managing QUARCC's corporate affairs and relationships. My focus is on ensuring high-quality corporate affairs and relationships within the organization."
        }
    ];

    const renderSocialLinks = (email, linkedin) => (
        <div className="flex justify-center gap-4 mt-4">
            {email && (
                <a href={`mailto:${email}`} className="text-gray-600 hover:text-primary transition-colors">
                    <i className="fa fa-envelope text-xl" aria-hidden="true"></i>
                </a>
            )}
            {linkedin && (
                <a href={linkedin} target="_blank" rel="noopener noreferrer" className="text-gray-600 hover:text-primary transition-colors">
                    <i className="fa fa-linkedin text-xl" aria-hidden="true"></i>
                </a>
            )}
        </div>
    );

    const MemberCard = ({ member }) => (
        <div className="flex flex-col items-center bg-white p-6 rounded-xl shadow-lg">
            <div className="w-24 h-24 mb-4 rounded-full overflow-hidden">
                <img 
                    src={member.image} 
                    alt={member.name}
                    className="w-full h-full object-cover"
                />
            </div>
            <h4 className="text-xl font-semibold text-gray-800">
                {member.name}
            </h4>
            <p className="text-gray-600 text-sm mb-4">
                {member.role}
            </p>
            <p className="text-gray-600 text-sm text-center mb-4">
                {member.bio}
            </p>
            {renderSocialLinks(member.email, member.linkedin)}
        </div>
    );

    return (
        <div className="mx-auto max-w-7xl px-4 py-12">
            {/* Presidents Section */}
            <div className="container relative mb-12">
                <div className="shrink-0 bg-border h-[1px] w-full" role="none" />
                <h3 className="absolute left-1/2 top-1/2 -translate-x-1/2 -translate-y-1/2 transform bg-background px-2 text-sm font-semibold text-muted-foreground md:text-xl">
                    Presidents
                </h3>
            </div>

            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
                {presidents.map((member, index) => (
                    <MemberCard key={index} member={member} />
                ))}
            </div>

            {/* Board Members Section */}
            <div className="container relative mt-16 mb-12">
                <div className="shrink-0 bg-border h-[1px] w-full" role="none" />
                <h3 className="absolute left-1/2 top-1/2 -translate-x-1/2 -translate-y-1/2 transform bg-background px-2 text-sm font-semibold text-muted-foreground md:text-xl">
                    Board Members
                </h3>
            </div>

            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
                {boardMembers.map((member, index) => (
                    <MemberCard key={index} member={member} />
                ))}
            </div>
        </div>
    );
}

export default TeamSection;
